getTimeLimit = function(testTimeStarted, testTimeLimit, itemTimeLimit) {
  limit = 0
  startedAgo = as.numeric(Sys.time()) - testTimeStarted
  testTimeLeft = 0
  if(testTimeLimit > 0) {
    testTimeLeft = max(testTimeLimit - startedAgo, 1)
    limit = testTimeLeft
  }
  if(itemTimeLimit > 0) {
    if(limit > 0) {
      limit = min(limit, itemTimeLimit)
    } else {
      limit = itemTimeLimit
    }
  }
  return(limit)
}

